            function onResize() {

                activeInd = 0;
                maxHeight = 0;

                $($latest).children().css('height', '');

                TweenMax.set($latest, { y: 0, ease: Power3.easeInOut });

                _.each($latest.children(), function(value, key, list) {

                    maxHeight = Math.max(maxHeight, $(value).outerHeight(true));

                });

                $($latest).children().css('height', maxHeight + 'px');
                $('.rotator-wrapper').css('height', maxHeight + 'px');


                len = $($latest[0]).children().length;

                maxHeight = $('.bar-text').outerHeight(true);


            }

            onResize();
